package ar.com.ucema.ia.chess.iama;import java.util.List;import java.util.Properties;import aima.search.framework.Problem;import aima.search.framework.Search;import aima.search.framework.SearchAgent;/** * Agente de busqueda especifico para el chessmaster *  * @see SearchAgent  * @author Matías Suárez */public class ChessInteligentAgent extends SearchAgent {	public ChessInteligentAgent(Problem arg0, Search arg1) throws Exception {		super(arg0, arg1);	}	public void printInstrumentation() {		Properties list = this.getInstrumentation();		System.out.println(list);	}		public void printActions() {		List<?> list = this.getActions();				for (Object object : list) {			System.out.println(object);		}	}	}